import React from "react";

import "./retouches.scss";

const RetoucheMenu = ({ selectedCat, setSelectedCat }) => {
  return (
    <div className="col menu">
      <h1>POST-PRODUCTION</h1>
      <div className="retouches-menu">
        <ul className="types">
          <li className="cat" onClick={() => selectedCat("onModel")}>
            ON MODEL
          </li>
          <li className="cat" onClick={() => selectedCat("plat")}>
            A PLAT
          </li>
          <li className="cat" onClick={() => selectedCat("lunettes")}>
            LUNETTES
          </li>
          <li className="cat" onClick={() => selectedCat("ghost")}>
            GHOST
          </li>
          <li></li>
        </ul>
      </div>
    </div>
  );
};

export default RetoucheMenu;
